import { DoxJS } from './index';


const actions = {
    inc: (store, value = 1) => {
        store.value += value
    },
    dec: (store, value = 1) => {
        store.value -= value;
    }
}

const listeners = {
    display: function(store) {
        console.log(store.value);
        console.log(this);
    }
}

let dox = new DoxJS({
    value: 0
});

dox.bindActions(actions);
dox.bindListeners(listeners);

dox.subscribe("display", false, {
    word: "Hello wolrd!"
});

dox.dispatch("inc", 11);
dox.dispatch("dec", 3);
